/**
 * Responsive Table
 */

.o-table--responsive {
  border-collapse: collapse;
  border-radius: 8px;
  padding: 0;
  width: 100%;
  border: 0;
}

.o-table--responsive thead {
  border: none;
  clip: rect(0 0 0 0);
  height: 1px;
  margin: -1px;
  overflow: hidden;
  padding: 0;
  position: absolute;
  width: 1px;
}

.o-table--responsive tr {
  display: block;
  margin-bottom: 10px;
  border: 1px solid #adadad;
  border-radius: 8px;
  overflow: hidden;
  background: white;
  box-shadow: 0px 4px 12px rgba(0, 0, 0, 0.05);
  transition: all 0.4s cubic-bezier(0.86, 0, 0.07, 1);
}

.o-table--responsive tr.this-is-active td:not(:first-child) {
  display: flex;
}

.o-table--responsive tr.this-is-active td:first-child::before {
  content: "- " attr(data-label);
}

.o-table--responsive th,
.o-table--responsive td {
  border-bottom: 1px solid #fff;
  background-color: #f3f3f3;
}

.o-table--responsive td {
  border-bottom: 1px solid #f3f3f3;
  display: flex;
  align-items: center;
  justify-content: space-between;
  min-height: 40px;
  text-align: right;
}

.o-table--responsive td:first-child {
  cursor: pointer;
  transition: all 0.4s cubic-bezier(0.86, 0, 0.07, 1);
  background-color: rgba(91, 144, 191, 0.2);
}

.o-table--responsive td:first-child:hover {
  background-color: rgba(91, 144, 191, 0.1);
}

.o-table--responsive td:first-child::before {
  content: "+ " attr(data-label);
  font-family: "Poppins", sans-serif;
  font-size: var(--font-size-m, 16px);
  font-style: normal;
  font-weight: 600;
  line-height: 1.6;
  text-transform: uppercase;
  letter-spacing: 1px;
}

.o-table--responsive td:last-child {
  border-bottom: 0;
}

.o-table--responsive td:not(:first-child) {
  display: none;
  margin: 0 10px;
  background-color: #fff;
}

.o-table--responsive td::before {
  content: attr(data-label);
  font-size: var(--font-size-s, 14px);
  font-weight: bold;
  color: black;
  text-align: left;
  margin-right: 20px;
}

