.c-nav-primary__menu-item.button a {
  font-family: "Poppins", sans-serif;
  font-size: var(--font-size-xs, 11px);
  font-style: normal;
  font-weight: bold;
  line-height: 1.6;
  text-transform: uppercase;
  letter-spacing: 1.2px;
  font-weight: 600;
  display: inline-flex;
  position: relative;
  justify-content: center;
  align-items: center;
  transition: all 0.5s ease;
  text-decoration: none;
  border-radius: 40px;
  text-align: center;
  line-height: 1.4;
  appearance: none;
  cursor: pointer;
  padding: 15px 20px;
  text-transform: uppercase;
  outline: 0;
  border: 0;
  color: #fff;
  background: linear-gradient(-250deg, #f33f4b 50%, #5b90bf 50%);
