    border-radius: 100px;
  }
}

.c-section-banner__body {
  display: flex;
  flex-direction: column;
  justify-content: center;
  padding-top: 20px;
}

@media (min-width: 851px) {
  .c-section-banner__body {
    padding-bottom: 20px;
  }
}

.c-section-banner__button {
  align-self: flex-start;
}

.c-section-banner__image {
  position: relative;
  height: auto;
  display: block;
  align-self: center;
  justify-content: flex-end;
}

@media (max-width: 1200px) {
  .c-section-banner__image {
    transform: scale(0.8) !important;
  }
}

@media (min-width: 851px) {
  .c-section-banner__image {
    left: calc(50% + 80px);
    position: absolute;
    top: 0;
  }
}

@media (min-width: 1201px) {
  .c-section-banner__image {
    transform: scale(1);
    right: -160px;
    left: auto;
  }
}

.c-section-banner__image picture {
  border-radius: 50%;
  overflow: hidden;
  z-index: 1;
  position: relative;
  border: 5vw solid #f33f4b;
  width: 75%;
  height: 75%;
  margin-left: auto;
  margin-right: auto;
}

@media (min-width: 851px) {
  .c-section-banner__image picture {
    width: 600px;
    height: 600px;
    min-width: 600px;
    margin-left: 0;
    border-width: 40px;
  }
}

.c-section-banner__image::before {
  content: "";
  display: none;
  background-color: #f33f4b;
  height: 100%;
  width: 50vw;
  position: absolute;
  left: 50%;
  top: 0;
  z-index: 0;
}

@media (min-width: 851px) {
  .c-section-banner__image::before {
    display: none;
  }
}

.c-section-banner__image::after {
  content: "";
  display: block;
  height: 100%;
  width: 100%;
  position: absolute;
  z-index: 0;
  border-left: 50vw solid transparent;
  border-right: 50vw solid transparent;
  border-top: 60vw solid #f33f4b;
  transform: translate(-50%, 0);
  left: 50%;
  top: 50%;
}

@media (min-width: 851px) {
  .c-section-banner__image::after {
    border-top: 400px solid transparent;
    border-bottom: 400px solid transparent;
    border-right: 460px solid #f33f4b;
    border-left: none;
    transform: translate(0, -50%);
    left: -50%;
    top: 50%;
  }
}

/**
