","/* ------------------------------------*\
    $SPACING
\*------------------------------------ */

$sizes: ("": $space, --quarter: $space / 4, --half: $space / 2, --and-half: $space * 1.5, --double: $space * 2, --triple: $space * 3, --quad: $space * 4, --zero: 0);

$sides: ("": "", --top: "-top", --bottom: "-bottom", --left: "-left", --right: "-right");

@each $size_key, $size_value in $sizes {
  .u-spacing#{$size_key} {
    & > * + * {
      margin-top: #{$size_value};
    }
  }

  @each $side_key, $side_value in $sides {
    .u-padding#{$size_key}#{$side_key} {
      padding#{$side_value}: #{$size_value};
    }

    .u-space#{$size_key}#{$side_key} {
      margin#{$side_value}: #{$size_value};
    }
  }
}

.u-spacing--left {
  & > * + * {
    margin-left: $space;
  }
}
","/* ------------------------------------ *\
    $LAYOUT
\* ------------------------------------ */

body {
  position: relative;

  &::before {
    content: "";
    display: block;
    height: 100vh;
    width: 100vw;
    background-color: $c-overlay;
    position: fixed;
    top: 0;
    left: 0;
    transition: all 0.5s ease;
    transition-delay: 0.25s;
    opacity: 0;
    visibility: hidden;
    z-index: 0;
  }
}

/**
 * Wrapping element to keep content contained and centered.
 */
@mixin l-wrap {
  position: relative;
  width: 100%;
  margin-left: auto;
  margin-right: auto;
  padding-left: $space;
  padding-right: $space;

  @include media(">xlarge") {
    padding-left: $space-double;
    padding-right: $space-double;
  }
}

.l-wrap {
  @include l-wrap;
}

/**
 * Layout containers - keep content centered and within a maximum width. Also
 * adjusts left and right padding as the viewport widens.
 */

@mixin l-container {
  position: relative;
  width: 100%;
  margin-left: auto;
  margin-right: auto;
  max-width: $max-width;
}

.l-container {
  @include l-container;

  &--s {
    width: 100%;
    max-width: $small;
  }

  &--m {
    width: 100%;
    max-width: $medium;
  }

  &--l {
    width: 100%;
    max-width: $large;
  }

  &--xl {
    width: 100%;
    max-width: $max-width-xl;
  }
}
