/**
 * Responsive Table
 */
.o-table--responsive {
  border-collapse: collapse;
  border-radius: $border-radius;
  padding: 0;
  width: 100%;
  border: 0;

  thead {
    border: none;
    clip: rect(0 0 0 0);
    height: 1px;
    margin: -1px;
    overflow: hidden;
    padding: 0;
    position: absolute;
    width: 1px;
  }

  tr {
    display: block;
    margin-bottom: $space / 2;
    border: 1px solid $c-gray--light;
    border-radius: $border-radius;
    overflow: hidden;
    background: white;
    box-shadow: $box-shadow--standard;
    transition: $transition-all;

    &.this-is-active {
      td:not(:first-child) {
        display: flex;
      }

      td:first-child::before {
        content: "- " attr(data-label);
      }
    }
  }

  th,
  td {
    border-bottom: 1px solid $c-white;
    background-color: $c-gray--lighter;
  }

  td {
    border-bottom: $border--standard-light;
    display: flex;
    align-items: center;
    justify-content: space-between;
    min-height: 40px;
    text-align: right;

    &:first-child {
      cursor: pointer;
      transition: $transition-all;
      background-color: rgba($c-secondary, 0.2);

      &:hover {
        background-color: rgba($c-secondary, 0.1);
      }

      &::before {
        content: "+ " attr(data-label);
        @include o-heading--m;
      }
    }

    &:last-child {
      border-bottom: 0;
    }

    &:not(:first-child) {
      display: none;
      margin: 0 $space-half;
      background-color: $c-white;
    }

    &::before {
      content: attr(data-label);
      font-size: $font-size-s;
      font-weight: bold;
      color: black;
      text-align: left;
      margin-right: $space;
    }
  }
}
